021)"></a></p><p style="margin-left:0px;text-align:justify;">Cng ngh <strong>ProMotion </strong>h tr tn s qut ti a <strong>120 Hz</strong> cho cm gic chm vut cc mt, cc chi tit chuyn ng trn mn hnh lin mch, trn tru, nh  tri nghim c ti u, c bit khi s dng mn hnh cho tc v  ha hay cho cc ta game hnh ng, khng b l c hi ghi im.</p><h3 style="margin-left:0px;text-align:justify;">Chinh phc mi tc v vi sc mnh t chip M1</h3><p style="margin-left:0px;text-align:justify;">Sc mnh hiu nng trn iPad Pro M1 t c nh s cng hng ca <strong>chip Apple M1 8 nhn</strong> mnh m v&nbsp;<strong>chip  ha Apple GPU</strong> v <strong>RAM 16 GB</strong>. Hiu qu a nhim mt m, duy tr s n nh ca my c khi s dng trn cc tc v nng nh  ha, chi game trc tuyn, ng thi, vi b nh trong n&nbsp;<strong>1 TB</strong>, tht thoi mi  lu tr tt c ti liu v kho nh chp, video yu thch ln thit b c nhn ny.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/522/269329/ipad-pro-m1-11-inch-wifi-cellular-1tb-2021-160122-083039.jpg"><img src="https://cdn.tgdd.vn/Products/Images/522/269329/ipad-pro-m1-11-inch-wifi-cellular-1tb-2021-160122-083039.jpg" alt="Sc mnh n tng - iPad Pro M1 11 inch WiFi Cellular 1TB (2021)"></a></p><p style="margin-left:0px;text-align:justify;">My h tr 5G cho tc  kt ni cc nhanh  bn c th ti d liu, xem video, thc hin cc tc v trc tuyn mt m.</p><h3 style="margin-left:0px;text-align:justify;">Tha sc sng to cng cm camera xn s</h3><p style="margin-left:0px;text-align:justify;">iPad Pro trang b b i camera gm <strong>camera gc rng 12 MP</strong> v <strong>camera siu rng 10 MP</strong>&nbsp;cng vi kh nng x l mnh m t chip M1 gip mang n bc nh chp v video hon ho, khng thua km nhiu so vi s dng smartphone.</p><p style="margin-left:0px;text-align:justify;"><strong>Camera TrueDepth 12 MP</strong>  mt trc h tr gc nhn siu rng <strong>122 </strong>&nbsp;FaceTime cc tt, km vi tnh nng <strong>Center Stage</strong> t ng nhn din,&nbsp;cn gc  gip cho ch th lun  gia khung hnh.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/522/269329/ipad-pro-m1-11-inch-wifi-cellular-1tb-2021-160122-083041.jpg"><img src="https://cdn.tgdd.vn/Products/Images/522/269329/ipad-pro-m1-11-inch-wifi-cellular-1tb-2021-160122-083041.jpg" alt="Camera xn s - iPad Pro M1 11 inch WiFi Cellular 1TB (2021)"></a></p><p style="margin-left:0px;text-align:justify;">Ngoi ra, <a href="https://www.thegioididong.com/may-tinh-bang-apple-ipad">Apple</a> h tr tnh nng m kha bng&nbsp;khun mt Face ID cng gia tng tin ch v kh nng bo mt cho iPad ca bn.</p><p style="margin-left:0px;text-align:justify;">Vi nhu cu dng <a href="https://www.thegioididong.com/may-tinh-bang">my tnh bng</a>  tn sut cao, bn s kh yn tm nh dung lng pin ca phin bn iPad ny t<strong> 28.65 Wh</strong> tng ng khong<strong> 7538 mAh</strong>, c s ti u ca chip M1 mang n<strong> 10 gi</strong> s dng lin tc cho nhu cu lt web hoc xem video. Cng ngh <a href="https://www.thegioididong.com/may-tinh-bang-sac-pin-nhanh"><strong>sc pin nhanh</strong></a><strong> 20 W</strong> s nhanh chng phc hi nng lng pin cho thit b trong tnh hung cn ngun.</p>	["/media/device/media/media_iacs231670753204170-1.jpeg", "/media/device/media/media_u3ysv51670753204173-2.jpeg", "/media/device/media/media_5ac1rc1670753204175-3.jpeg", "/media/device/media/media_v3qldd16707532041771-4.jpg", "/media/device/media/media_e5fmwn1670753204179-5.jpeg", "/media/device/media/media_bu7g881670753204181-6.jpeg"]	2	\N	2	2022-12-22 12:59:00.900947+00	1	\N
