18	MOBIFONE CNG PH "KHNG GIAN MI"	Cre: Tui tr online		<h2 style="margin-left:0px;"><strong>Nm 2022, MobiFone d kin doanh thu cng ty m tnh theo phng php ghi nhn doanh thu theo dung lng thc t s dng c t 28.329 t ng, li nhun trc thu c tnh t 2.713 t ng.</strong></h2><p style="margin-left:0px;">Doanh thu t khng gian mi "Make in MobiFone" tng trng trn 60% so vi 2021</p><h2 style="margin-left:0px;"><strong>Doanh thu data tng gn 27% so vi nm 2021</strong></h2><p style="margin-left:0px;">Hu ht cc doanh nghip u t mc tiu thn trng trong nm 2022 khi a ra cc d bo kh khn cho nn kinh t sau dch COVID-19.</p><p style="margin-left:0px;">Tuy nhin, nhng g din ra trong nm 2022 thm ch vt qua mi d bo trc  ca cc chuyn gia cng nh cc t chc ti chnh hng u th gii nh din bin cuc chin tranh gia Nga v Ukraine; gi nguyn vt liu, gi du tng t bin; lm pht ph bng en nn nn kinh t ton cu; li sut tng  hu ht cc th trng hay chnh sch Zero COVID nghim ngt ti Trung Quc</p><p style="margin-left:0px;">Nhng din bin ny khin hot ng sn xut, kinh doanh ca cc doanh nghip u b nh hng.</p><p style="margin-left:auto;"><a href="https://cdn.tuoitre.vn/471584752817336320/2023/1/7/photo-1-16730843153441238617221.jpg"><img class="image_resized" style="width:730px;" src="https://cdn.tuoitre.vn/thumb_w/730/471584752817336320/2023/1/7/photo-1-16730843153441238617221.jpg" alt="Doanh thu t Khng gian mi ca MobiFone tng trng hn 60% - nh 2."></a></p><p style="margin-left:0px;">Th trng vin thng gp nhiu kh khn sau i dch</p><p style="margin-left:0px;">Bo co kt qu kinh doanh nm 2022, MobiFone cho bit, d kin doanh thu cng ty m tnh theo phng php ghi nhn "doanh thu theo dung lng thc t s dng" c t 28.329 t ng, li nhun trc thu cng ty m c t 2.713 t ng.</p><p style="margin-left:0px;">Theo hng dn ca B Ti chnh v B Thng tin v Truyn thng v bt u p dng t nm 2022, cc ch tiu trn c hch ton theo phng php ghi nhn "doanh thu theo dung lng thc t s dng" thay v phng php ghi nhn "doanh thu ti thi im thu tin bn th tr trc".</p><p style="margin-left:0px;">Nm 2022, MobiFone  bm st chin lc pht trin ca tng cng ty n nm 2030 vi 3 tr ct ch lc: H tng s, Gii php s/Nn tng s v Dch v ni dung s.</p><p style="margin-left:0px;">C th, trin khai cng tc pht trin thu bao song song vi vic tng cng r sot, qun l, chun ha thng tin thu bao theo quy nh ca Nh nc v xc nh y l cng vic thng xuyn, cn thit  xy dng c s d liu chnh xc, y  cho vic trin khai cc dch v mi.</p><p style="margin-left:0px;">Tp trung y mnh kinh doanh data  b p cho s st gim doanh thu cc dch v vin thng di ng, doanh thu data nm 2022 d kin c t mc tng trng gn 27% so vi thc hin nm 2021.</p><p style="margin-left:0px;">T thng 4/2022, cng ty ra mt h sinh thi Ti chnh s vi Dch v V in t MobiFone Pay v Tin in t Mobile Money  cung cp ti ngi dng vi y  cc tnh nng c bn ca mt dch v ti chnh.</p><p style="margin-left:0px;">Ht nm 2022, d kin s pht trin 600 nghn user ng k s dng cc dch v vi doanh thu bn hng trn 550 t, m ra mt hng i mi trong vic hon thin H sinh thi MobiFone mang ti cho khch hng.</p><p style="margin-left:0px;">Thng k n thng 12/2022, tng s khch hng Mobile Money khong gn 3 triu, trong  s lng khch hng  nng thn, min ni, vng su, vng xa l hn 2 triu khch hng, chim 70%, nh vy tim nng tng trng ca mng Mobile Money vn cn rt ln.</p><p style="margin-left:0px;">Trong nm 2022, cng ty  y mnh nh hng "Make in MobiFone" v sn xut cng nghip, mang li doanh thu tng trng trn 60% so vi 2021. c bit, cng ty l 1 trong 5 n v u tin ti Vit Nam c php cung cp dch v chng thc hp ng in t, hng n mc tiu doanh nghip 4.0.</p><p style="margin-left:0px;">Cng ty cng tp trung y mnh chuyn i s ni b v chuyn i s cho x hi thng qua vic tch cc tham gia cng tc xy dng nn tng Chuyn i s Quc gia v ng k tham gia vo mng li h tr Chuyn i s cc doanh nghip SME.</p><p>&nbsp;</p><p style="margin-left:0px;">Nghin cu pht trin sn phm MobiFone Meeting l sn phm hp trc tuyn th h mi do chnh cc k s Cng ngh thng tin ca cng ty to nn.</p><p style="margin-left:0px;">H thng c th hp trc tuyn cng lc ti 1.000 im cu bt camera vi cht lng hnh nh, m thanh r nt. Hin ti, h thng  c B Thng tin truyn thng a vo th nghim din rng ti B, cc tnh/thnh ph, tin ti cng nhn l nn tng Chuyn i s Quc gia.</p><p style="margin-left:0px;">Ngoi ra, MobiFone  cung cp tri nghim dch v 5G thng mi cho khch hng ti TP.HCM, H Ni, Hu, Nha Trang, Ph Quc vi tc  DL cao trn 1.7Gbps, vi nhiu dch v hp dn nh: truy cp internet tc  siu cao, dch v video theo yu cu vi  nt cao 4K/8K, dch v thc t o VR/AR, dch v Cloud gaming</p><h2 style="margin-left:0px;"><strong>Hng i mi khi ngun thu chnh  bo ha</strong></h2><p style="margin-left:0px;">Trc thc t th trng vin thng di ng (thoi/sms)  bo ha, doanh thu c xu hng gim, bi ton t ra vi MobiFone ni ring v cc nh mng ang hot ng trn th trng l tm kim v y mnh nhng ngun thu khc  b p.</p><p style="margin-left:0px;">Theo , nm 2023, cng ty s thc hin chin lc y mnh kinh doanh trn cc lnh vc mi nh ti chnh s, y t s, gio dc s, vn cn nhiu ngun lc v h thng, con ngi trong giai on u trin khai.</p><p style="margin-left:0px;">Lnh o MobiFone cho bit, d kin n nm 2025 doanh nghip s pht trin h tng s trong nhm dn u, lm ch cng ngh li, ci thin nhanh trong vic pht trin khch hng mi, gi chn khch hng hin hu v to nhiu ngun thu mi, tng trng mnh m doanh thu dch v s.</p><p style="margin-left:auto;"><a href="https://cdn.tuoitre.vn/471584752817336320/2023/1/7/photo-2-16730843161151606460036.jpg"><img class="image_resized" style="width:730px;" src="https://cdn.tuoitre.vn/thumb_w/730/471584752817336320/2023/1/7/photo-2-16730843161151606460036.jpg" alt="Doanh thu t Khng gian mi ca MobiFone tng trng hn 60% - nh 3."></a></p><p style="margin-left:0px;">Chuyn mnh ln nn tng s l hng i mi ca nhiu doanh nghip</p><h2 style="margin-left:0px;"><strong>Mc tiu ca MobiFone</strong></h2><p style="margin-left:0px;">- Tr thnh doanh nghip thuc nhm ht nhn gp phn thuc y chuyn i s quc gia;</p><p style="margin-left:0px;">- i hng u trong vic u t, h tr cc doanh nghip khc trong pht trin h tng s v chuyn i s;</p><p style="margin-left:0px;">- Thc hin tt vai tr dn dt v h tng cng ngh s, nn tng cho kinh t s, x hi s gn vi m bo an ton, an ninh thng tin;</p><p style="margin-left:0px;">- Sn xut thit b phc v h thng 5G; chuyn giao cng ngh cho cc doanh nghip khc.</p><p style="margin-left:0px;">- i u thc hin cc chin lc quc gia, chin lc ngnh thng tin v truyn thng.</p>	2023-02-03 08:09:25.128342+00	0	\N	\N	2023-02-14 03:46:38.933343+00	0
