5	TUYN CNG TC VIN BN HNG	<h2 style="margin-left:0px;"><span style="background-color:transparent;color:rgb(0,0,128);"><strong>M t cng vic</strong></span></h2><ul><li><span style="background-color:transparent;">Lm vic trc tip ti cng ty 4 gi/ngy v 3 ngy/tun.</span></li><li><span style="background-color:transparent;">Cp nhp cc kin thc mi v dch v.</span></li><li><span style="background-color:transparent;">Phi hp vi nhn vin kinh doanh chnh thc ca vHost trin khai cc chng trnh khuyn mi dch v trn cc knh online nh: mng x hi, forum, workshop, group trn facebook, offline</span></li><li><span style="background-color:transparent;">Tm kim khch hng v m rng cc mi quan h da trn cc quan h c nhn ca mnh.</span></li><li><span style="background-color:transparent;">M rng cc mi quan h vi khch hng v duy tr quan h vi khch hng thng xuyn.</span></li><li><span style="background-color:transparent;">Theo di v h tr cng ng trn cc mng x hi, forum, website  nm bt xu th ca khch hng cng nh ng gp  kin cho cng ty.</span></li><li><span style="background-color:transparent;">Theo di cng ng trn cc mng x hi v din n  thu thp cc phn hi ca khch hng v dch v ti cng ty. Sau  trnh ln cc b phn cp cao hn  xin  kin h tr x l trong trng hp khng x l c.</span></li><li><span style="background-color:transparent;">Thu thp thng tin nhu cu ca khch hng, phn tch v phi hp cng nhn vin kinh doanh chnh thc t vn cho khch hng.</span></li><li><span style="background-color:transparent;">T vn cho khch hng v cc dch v ca cng ty, thuyt phc khch hng v tin hnh k kt hp ng, hon tt cc th tc ng k v nhn thanh ton vi khch hng.</span></li><li><span style="background-color:transparent;">m bo lm vic ng theo quy trnh cng ty  ra.</span></li><li><span style="background-color:transparent;">V mt s cng vic khc do cng ty  xut.</span></li></ul><h2 style="margin-left:0px;"><span style="background-color:transparent;color:rgb(0,0,128);"><strong>Yu cu</strong></span></h2><p style="margin-left:0px;"><strong>K nng chuyn mn:</strong></p><ul><li><span style="background-color:transparent;">ang l sinh vin nm 3/4 ti cc trng Cao ng/i hc cc khi Marketing, QTKD, Ngoi thng, Cng ngh thng tin hoc cc ngnh c lin quan.</span></li><li><span style="background-color:transparent;">C hiu bit c bn v marketing, qung co v truyn thng trc tuyn.</span></li><li><span style="background-color:transparent;">Ngoi ng: nghe, ni, c, vit.</span></li><li><span style="background-color:transparent;">C ngoi hnh a nhn, kh nng giao tip tt.</span></li><li><span style="background-color:transparent;">Thng minh, nhanh nhn, trung thc v chm ch.</span></li><li><span style="background-color:transparent;">K nng vit lch tt.</span></li><li><span style="background-color:transparent;">K nng m phn v thng lng tt.</span></li><li><span style="background-color:transparent;">T duy x l tnh hung nhanh nhn.</span></li><li><span style="background-color:transparent;">Thnh tho cc cng c vn phng nh: Word, Excel, PowerPoint, Outlook.</span></li></ul><p style="margin-left:0px;"><strong>K nng mm</strong><span style="background-color:transparent;">:</span></p><ul><li><span style="background-color:transparent;">K nng vit v trnh by ti liu k thut r rng, mch lc.</span></li><li><span style="background-color:transparent;">T duy c h thng v kh nng ch ng t chc, sp xp cng vic.</span></li><li><span style="background-color:transparent;">Lm vic theo nhm.</span></li><li><span style="background-color:transparent;">Trnh by thuyt trnh.</span></li></ul><p style="margin-left:0px;"><strong>Yu cu c bit</strong><span style="background-color:transparent;">:</span></p><ul><li><span style="background-color:transparent;">Sn sng h tr ng nghip trong cng vic.</span></li><li><span style="background-color:transparent;">Lm vic c trch nhim vi cng vic c giao.</span></li><li><span style="background-color:transparent;">Tinh thn cu tin cao v lun bit hc hi cc m hnh cng vic mi  p dng cho cng vic ngy mt tt hn.</span></li><li><span style="background-color:transparent;">Ch ng thc hin cc cng vic c giao, a ra phng n thc hin cng vic, bo co kt qu cng vic r rng.</span></li><li><span style="background-color:transparent;">Chu c p lc cng vic cao.</span></li></ul>	2023-02-02 07:30:02.842019+00	2023-01-03 08:09:25.128342+00	2023-03-02 01:56:26.555613+00	0	3	\N	5 triu ng/ thng (cha tnh hoa hng)	189 Nguyn Vn Linh, Qun 7
