1	\N	intro_setting	\N	<h4><span style="font-family:'Times New Roman', Times, serif;">Cng ty Dch v MobiFone Khu vc 8 (Trc thuc Tng Cng Ty vin thng MobiFone), Tr s t ti 236A Phan Trung, Phng Tn Tin, TP. Bin Ha, Tnh ng Nai. Thc hin kinh doanh trong phm vi cc tnh: ng Nai, B Ra  Vng Tu, Bnh Dng, Bnh Phc, Bnh Thun, Lm ng, Long An, Ninh Thun, Ty Ninh. cung cp cc dch v v vin thng v thit b di ng cho khch hng.  thun tin hn cho khch hng trong vic tm kim mt thit b di ng, gi cc 3G/4G v c bit l sim s p theo nhu cu, website ca Cng ty dch v MobiFone KV8 ra i.</span></h4><h4 style="text-align:justify;"><span style="font-family:'Times New Roman', Times, serif;">Tn chnh thc: CNG TY DCH V MOBIFONE KHU VC 8&nbsp;</span></h4><h4 style="text-align:justify;"><span style="font-family:'Times New Roman', Times, serif;">Trc thuc: Tng Cng Ty vin thng MobiFone</span></h4><h4 style="text-align:justify;"><span style="font-family:'Times New Roman', Times, serif;">Ngy thnh lp: 10/02/2015</span></h4><h4 style="text-align:justify;"><span style="font-family:'Times New Roman', Times, serif;">Tr s&nbsp;chnh&nbsp;t ti 236A Phan Trung, Phng Tn Tin, TP. Bin Ha, Tnh ng Nai..</span></h4><h4 style="text-align:justify;"><span style="font-family:'Times New Roman', Times, serif;"><i>(Cn c Quyt nh s 410/Q-MOBIFONE-TCHC ngy 16 thng 03 nm 2015 ca Tng Gim c Tng Cng ty v vic thnh lp cc n v thuc Cng ty Dch v MobiFone Khu vc 8 thuc Tng Cng ty Vin thng MobiFone).&nbsp;</i></span></h4><h4 style="text-align:justify;"><span style="font-family:'Times New Roman', Times, serif;">(Cng ty Dch v MobiFone Khu vc 8 tin thn l Trung tm Thng tin Di ng Khu vc VI thnh lp ngy:29/12/2010 theo Quyt nh s 2132/Q-VMS-TC ngy 29 thng 12 nm 2010 ca Ch tch Cng ty Thng tin di ng v vic thnh lp Trung tm thng tin di ng khu vc VI thuc Cng ty Thng tin di ng)&nbsp;</span></h4><h4 style="text-align:justify;"><span style="font-family:'Times New Roman', Times, serif;">Thc hin kinh doanh trong phm vi&nbsp;9 tnh: ng Nai, B Ra  Vng Tu, Bnh Dng, Bnh Phc, Bnh Thun, Lm ng, Long An, Ninh Thun, Ty Ninh v&nbsp;cung cp cc dch v v vin thng v thit b di ng cho khch hng.&nbsp;</span></h4><h4 style="text-align:justify;"><span style="font-family:'Times New Roman', Times, serif;">Chc nng:&nbsp;</span></h4><h4 style="text-align:justify;"><span style="font-family:'Times New Roman', Times, serif;">+ T chc, thc hin cng tc kinh doanh (bao gm bn hng, chm sc khch hng, truyn thng) ton b cc dch v do Tng Cng ty cung cp ( dch v vin thng, dch v gi tr gia tng, dch v cng ngh thng tin) i vi tt c cc nhm khch hng ca Tng cng ty theo quy hoch v k hoch pht trin ca Tng Cng ty.&nbsp;</span></h4><h4 style="text-align:justify;"><span style="font-family:'Times New Roman', Times, serif;">+ Trin khai cc nhhim v khc do Tng Cng ty giao.</span></h4><figure class="image"><img src="https://mobi8-ms.pvssolution.com:10183/media/up_file/7zcmltfile_img.png" alt="Gii Thiu - Mobifone"></figure><p>&nbsp;</p>	\N	TEXT	t
